using namespace std;

class Solution {
public:
	int maxRotateFunction(vector<int>& A) {
		if (A.empty()) return 0;
		int res = 0;
		int n = A.size();
		int asum = 0;
		for (int i = 0; i < n; ++i) {
			asum += A[i];
			res += (i * A[i]);
		}
		int cur = res;
		for (int i = 1; i < n; ++i) {
			cur = (cur - asum) + n * A[i - 1];
			res = max(cur, res);
		}
		return res;
	}
};

